import { Link, NavLink } from 'react-router-dom';
import classes from './MainNavigation.module.css';


/**
 * 
 * @returns 
 */
function MainNavigation() {
  return (
    <header className={classes.header}>
      <nav>
        <ul className={classes.list}>
          <li>
            <NavLink to = "/events" 
            className={({isActive})=>isActive? classes.active:undefined}>Events</NavLink>
          </li>
          <li>
            <NavLink to = "/events/eventDetails:eventId" className={({isActive})=>isActive? classes.active:undefined}>Events Details</NavLink>
          </li>
          <li>
            <NavLink to = "/events/new" className={({isActive})=>isActive? classes.active:undefined}>Add Event</NavLink>
          </li>
          <li>
            <NavLink to = "/events:eventId/edit" className={({isActive})=>isActive? classes.active:undefined}>Edit Event</NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default MainNavigation;
